var React = require('react');
var d3 = require('d3');

var LineChart = React.createClass({displayName: "LineChart",

  componentWillUpdate: function() {
    var graph = d3.select('#' + this.props.id);
    var lineData = this.props.data;
    var margin = {
      bottom: 10,
      top: 10
    };
    var width = this.props.width;
    var height = this.props.height;

    var xRange = d3
      .scale
      .linear()
      .range([0, width])
      .domain([
        d3.min(lineData, function(d) {
          return d.x;
        }),
        d3.max(lineData, function(d) {
          return d.x;
        })
      ]);

    var yRange = d3
      .scale
      .linear()
      .range([height - margin.bottom - margin.top, 0])
      .domain([
        d3.min(lineData, function(d) {
          return d.y;
        }),
        d3.max(lineData, function(d) {
          return d.y;
        })
      ]);

    // debugger;

    var lineFunc = d3
      .svg
      .line()
      .x(function(d) {
        return xRange(d.x);
      })
      .y(function(d) {
        return yRange(d.y);
      })
      .interpolate('basis');

    var areaFunc = d3
      .svg
      .area()
      .x(function(d) {
        return xRange(d.x);
      })
      .y0(height)
      .y1(function(d) {
        return yRange(d.y);
      })
      .interpolate('basis');

    var points = lineFunc(lineData);
    var area = areaFunc(lineData);

    graph
      .select('g')
      .remove();

    graph
      .append('g')
      .append('svg:path')
      .attr('class', 'graph--area')
      .attr('d', area)
      .attr('transform', 'translate(0,' + margin.top + ')');;

    graph
      .select('g')
      .append('svg:path')
      .attr('class', 'graph--line')
      .attr('d', points)
      .attr('transform', 'translate(0,' + margin.top + ')');
  },

  render: function() {
    return (
      React.createElement("svg", {className: "graph", id: this.props.id}, 
        React.createElement("defs", null, 
          React.createElement("linearGradient", {
            id: this.props.slug + '--gradient', 
            x1: "0%", 
            y1: "0%", 
            x2: "0%", 
            y2: "100%"}, 
            React.createElement("stop", {className: this.props.slug + '--gradient--top', offset: "0%"}), 
            React.createElement("stop", {className: this.props.slug + '--gradient--bottom', offset: "100%"})
          )
        )
      )
    );
  }
});

module.exports = LineChart;


